script: |
  super -f text -I q4275.spq | sort > q4275.out

inputs:
  - name: q4275.spq
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( + 25 * + col0 ) NOT BETWEEN 54 * + 43 + - 67 AND col0 / col0 - col1;
  - name: tab0

outputs:
  - name: q4275.out
    data: |
      10
      47
      99
